import { Link } from "react-router-dom";
import './card.css';

export const Card = ({ name , image , id}) => {

const timer = () => {
  setTimeout( () => {
      <h1>Cargando...</h1>
  },1000);
}

  return (
    <div className="contCards">
      <div  className="card">
        <Link to={`/detail/${id}`} onChange={timer}>
          <h3 className="title-card">{name}</h3>
          <img src={image} alt='Not found' className="img"/>
        </Link>
      </div>
    </div>
  )
};
